%pyspark
from systemml import MLContext, dml

algo = """
    max_iter = 10000; batch_size = 5; n = nrow(X) - batch_size;
    w = matrix(0, rows=ncol(X), cols=1)
    lr = 0.1; X_full = X; y_full = y;
    for(i in 1:max_iter){
        j = (i %% n)+1;
        X = X_full[j:(j+batch_size),]; y = y_full[j:(j+batch_size),];
        XtX = t(X) %*% X
        dw = XtX %*%w - t(X) %*% y
        w = w - dw*lr
    }
"""
ml = MLContext(sc)
script = dml(algo).input(X=diabetes_X_train, y=diabetes_y_train).output('w')
out = ml.execute(script)
w = out.get('w').toNumPy()
plt.plot(diabetes_X_test, w*diabetes_X_test, color='green', linestyle ='dashed')
show(plt)
